import React from 'react'
import Contactitem from './Contactitem';
function Contact() {
  return (
    <div className='container'>
        <div className="row" my-5>
            <div className="col-md-6 mt-4 mx-auto">
                <div className="card">
                    <table className='table'>
                        <thead>
                            <tr>
                                <th>Nom & Prenom</th>
                                <th>Telephone</th>
                                <th>Action</th>
                            </tr>
                        </thead>
                        <tbody>
                            {
                            contactArry.map((contact,index)=>
                            <Contactitem key={index} contact={contact}/>
                            )
                            }
                          
                        </tbody>
                    </table>
                </div>
            </div>
        </div>
    </div>
   
  )
}
const contactArry=[
    {
        "name":'mohamed',
        'tele':'064563563'
    },
    {
        "name":'walid',
        'tele':'064663537'
    },
    {
        "name":'saad',
        'tele':'064567534'
    },
]
export default Contact
